eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"prototiposProvider\": () => (/* binding */ prototiposProvider),\n/* harmony export */   \"years\": () => (/* binding */ years)\n/* harmony export */ });\nconst prototiposProvider = {\n  NK319: {\n    year: 2019,\n    sectionStart: {\n      top: false,\n      left: true\n    },\n    positions: {\n      general: 5,\n      categories: [{\n        name: 'custos',\n        position: 5\n      }, {\n        name: 'apresentao',\n        position: 5\n      }, {\n        name: 'design',\n        position: 1\n      }, {\n        name: 'acelerao'\n      }, {\n        name: 'skidpad'\n      }, {\n        name: 'autocross',\n        position: 5\n      }, {\n        name: 'enduro'\n      }],\n      text: ['Sendo o terceiro carro fabricado, melhorou os ndices de eficincia e autonomia da equipe e conseguiu uma melhora significativa no desempenho em pista, em razo do projeto dinmico mais refinado, menores perdas mecnicas e solues aerodinmicas inovadoras.', 'Lanado em 31 de outubro de 2019, foi  competio cheio de expectativas pela surpreendente segunda colocao no ano anterior. O grande empenho da equipe durante o ano levou ao primeiro lugar na prova de projeto, porm o prottipo enfrentou alguns imprevistos nas provas dinmicas e assim, conquistou a quinta colocao geral.']\n    },\n    especifications: {\n      dtec: 'DTEC-NK319.svg',\n      data: [{\n        info: 'Motor',\n        data: '2x WEG VE-M01'\n      }, {\n        info: 'Autonomia',\n        data: '22 km'\n      }, {\n        info: 'Potncia Mx.',\n        data: '54 cv (39,7kW)'\n      }, {\n        info: 'Bitola Diant.',\n        data: '1170 mm'\n      }, {\n        info: 'Torque Mx.',\n        data: '8,2 Nm (39,7 kW)'\n      }, {\n        info: 'Bitola Tras.',\n        data: '1150 mm'\n      }, {\n        info: '0 - 75m',\n        data: '5,1 s'\n      }, {\n        info: 'Entre-eixos',\n        data: '1150 mm'\n      }, {\n        info: 'Velocidade Mx.',\n        data: '99 Km/h'\n      }, {\n        info: 'Massa',\n        data: '279 kg'\n      }, {\n        info: 'Consumo',\n        data: '216 Wh/km'\n      }, {\n        info: 'Massa Diant.',\n        data: '49,9%'\n      }]\n    },\n    subsystems: [{\n      type: 'title',\n      content: 'ELETRNICA'\n    }, {\n      type: 'text',\n      content: 'O projeto eletrnico teve dois objetivos principais no ano de 2019: sensoriamento abrangente do veculo, permitindo diagnstico e validao dos diversos sistemas do carro; e aumento da autonomia atravs do melhor gerenciamento de energia, visando alcanar os 22 quilmetros da prova de Enduro.'\n    }, {\n      type: 'subsystem',\n      content: 'CONTROLE'\n    }, {\n      type: 'text',\n      content: 'Em 2019 houve a implementao de frenagem regenerativa no veculo e foi investido tempo em pesquisas sobre Controle de Arrancada e Vetorizao de Torque para aplicaes futuras. Tambm foi aprimorada a estabilidade de comunicao do sistema de controle com os outros mdulos.'\n    }, {\n      type: 'subsystem',\n      content: 'TELEMETRIA & AQUISIO'\n    }, {\n      type: 'text',\n      content: 'Investiu-se em instrumentao e aquisio de dados, tornando possvel medir deformao de peas estruturais, temperatura dos discos de freios, curso dos amortecedores, presso nas linhas de freio, alm das aceleraes e velocidade angular do veculo. Esse processo ainda contou com o desenvolvimento de um datalogger para registro de todos os dados aferidos. Associado a isso, os sistemas de telemetria e interface foram aprimorados, garantindo que tanto a equipe nos boxes quanto o piloto conseguissem fazer uma anlise instantnea das condies do veculo, auxiliando na definio de estratgias e acompanhamento dos sinais vitais. Houve substituio dos mdulos de telemetria NRF para o Xbee, aumentando a eficincia e a taxa de transmisso, e reformulou-se a interface grfica de visualizao de dados em tempo real, podendo agora ser acessada livremente em computadores, tablets e celulares por quaisquer integrantes da equipe simultaneamente.'\n    }, {\n      type: 'subsystem',\n      content: 'BANCO DE BATERIAS'\n    }, {\n      type: 'text',\n      content: 'A principal mudana no banco de baterias foi o acrscimo de mais um ramo de clulas em paralelo, a fim de aumentar a capacidade de carga e possibilitar a finalizao da prova de Enduro juntamente com o novo pacote aerodinmico e a frenagem regenerativa. O banco passou a ter 72 clulas e a configurao tornou-se 24s3p. Um dos destaques do projeto foi a diminuio do volume da estrutura em 10% em relao ao ano anterior, mesmo com o aumento da quantidade de clulas em 50%. Tambm, o isolamento eltrico foi otimizado e reduziu-se a quantidade de parafusos necessrios para a montagem, contribuindo para a segurana, facilidade de manuteno e baixo peso.'\n    }, {\n      type: 'subsystem',\n      content: 'BATTERY MONITORING SYSTEM (BMS)'\n    }, {\n      type: 'text',\n      content: 'O BMS  modular, baseado em master/slave e amplivel  foi otimizado, contando com filtros via software e um display touchscreen para controle de parmetros e monitorao local em tempo real, auxiliando no monitoramento do carregamento e diagnstico de manuteno do banco.'\n    }, {\n      type: 'title',\n      content: 'MECNICA'\n    }, {\n      type: 'subsystem',\n      content: 'POWERTRAIN'\n    }, {\n      type: 'image',\n      content: ['POWERTRAIN.png']\n    }, {\n      type: 'text',\n      content: 'O foco base para a transmisso 2019 foi aumentar a confiabilidade e a eficincia do sistema, bem como otimizar o dimensionamento das peas. Falhas estruturais e de fabricao foram corrigidas, a fim de reduzir vibraes e evitar desgaste acentuado do sistema. Tambm foi possvel reduzir a massa e a inrcia rotacional dos componentes, tanto pela otimizao estrutural, quanto pela migrao para o uso de juntas e semieixos de projeto prprio. Em paralelo, deu-se incio aos estudos dos efeitos da fadiga em componentes mecnicos, visando alicerar o desenvolvimento de uma metodologia de dimensionamento de peas mais precisa e condizente com as aplicaes dos prottipos da equipe.'\n    }, {\n      type: 'subsystem',\n      content: 'CHASSI'\n    }, {\n      type: 'image',\n      content: ['CHASSI.png']\n    }, {\n      type: 'text',\n      content: 'Entre os principais avanos do projeto em relao ao ano anterior se destaca o melhor dimensionamento das juntas soldadas e parafusadas, realizado de acordo com normas nacionais vigentes, garantindo maior confiabilidade ao veculo e criando as bases para reduo das dimenses das fixaes em projetos futuros. Em relao ao chassi propriamente, maior robustez e rigidez torcional foram alcanadas, de modo a suportar e distribuir melhor as cargas impostas, permitindo maior controle da distribuio de transferncia lateral de carga. Alm disso, o seu processo de fabricao foi mais acurado, atravs do uso de um novo tipo de gabarito  planos cortados a laser  aumentando a correspondncia entre o projetado e o fabricado. Por ltimo, foram feitos ensaios, testes e aquisies de dados visando assegurar a qualidade da estrutura e validar as simulaes computacionais realizadas na fase inicial.'\n    }, {\n      type: 'subsystem',\n      content: 'AERODINMICA'\n    }, {\n      type: 'image',\n      content: ['AERO.png']\n    }, {\n      type: 'text',\n      content: 'A nova meta da equipe de completar a prova de enduro mesmo com limitaes de baterias e motores fez com que o pacote aerodinmico fosse focado em proporcionar maior eficincia ao veculo. Com base nisso, a asa dianteira, a carenagem traseira e o bico foram desenvolvidos com o intuito exclusivo de diminuir a resistncia aerodinmica, o que resultou em uma reduo final de 50% nos nveis de arrasto. Todo o projeto foi baseado no uso de CFD para o desenvolvimento e prototipagem e, de modo a avaliar de forma efetiva a eficincia do pacote aerodinmico e seus impactos nas provas e pontuaes finais, testes em tnel de vento e em pista foram realizados.'\n    }, {\n      type: 'subsystem',\n      content: 'DIREO'\n    }, {\n      type: 'image',\n      content: ['DIRECAO.png']\n    }, {\n      type: 'text',\n      content: 'A direo 2019 teve um foco maior no aumento da responsividade do sistema, a fim de torn-lo mais direto. Para isso, reduziu-se a razo de esteramento de 5:1 para 3,5:1 e desenvolveu-se um sistema de reduo de folga da coluna, tornando o veculo mais gil em mudanas de trajetria. Ainda, conferiu-se ajustabilidade ao sistema atravs de steering arms substituveis e obteve-se uma reduo de massa de 25% atravs do redesenho dos componentes j existentes.'\n    }, {\n      type: 'subsystem',\n      content: 'SUSPENSO'\n    }, {\n      type: 'image',\n      content: ['SUSP-DIANT.png', 'SUSP-TRAS.png']\n    }, {\n      type: 'text',\n      content: 'Em 2019 otimizou-se o projeto cinemtico da suspenso, visando alcanar um ganho de cambagem mais adequado; investiu-se novamente em ajustabilidade, com o desenvolvimento de barras estabilizadoras do tipo faca giratria, consideradas mais versteis, e de camber plates, capazes de proporcionar diferentes ajustes de cambagem; e reduziu-se a massa no-suspensa, atravs do emprego de alumnio aeronutico nas mangas de eixo e cubos de roda, contribuindo para a aderncia dos pneus mediante irregularidades da pista e para a reduo da inrcia rotacional do veculo e das partes girantes.'\n    }, {\n      type: 'subsystem',\n      content: 'FREIOS'\n    }, {\n      type: 'image',\n      content: ['FREIO.png']\n    }, {\n      type: 'text',\n      content: 'O projeto do sistema de freios do NK-319 teve trs focos principais: validao do comportamento terico do sistema, reduo de massa de peas julgadas superdimensionadas e anlises mais precisas das cargas mecnicas e trmicas impostas aos componentes. Sensores de presso e temperatura foram empregados, possibilitando avaliar as presses nas linhas hidrulicas em diferentes condies de frenagem e a necessidade de arrefecimento dos discos de freio, validando o projeto. Por fim, atravs de otimizaes topolgicas, 23% da massa do sistema foi reduzida.'\n    }]\n  },\n  NK218: {\n    year: 2018,\n    sectionStart: {\n      top: false,\n      left: false\n    },\n    positions: {\n      general: 2,\n      categories: [{\n        name: 'custos',\n        position: 2\n      }, {\n        name: 'apresentao',\n        position: 10\n      }, {\n        name: 'design',\n        position: 3\n      }, {\n        name: 'acelerao',\n        position: 10\n      }, {\n        name: 'skidpad',\n        position: 3\n      }, {\n        name: 'autocross',\n        position: 2\n      }, {\n        name: 'enduro',\n        position: 2\n      }],\n      text: ['O NK-218  o nosso 2 prottipo, fabricado no ano de 2018 e lanado em 9 de novembro. Foi o primeiro carro da equipe a conseguir realizar as provas dinmicas, e no decepcionou.', 'Era um veculo de alta confiabilidade eletrnica e bom comportamento dinmico, apresentando um limite de aderncia de fcil explorao. Coroado com o segundo lugar geral da competio, o modelo conta com diversos prmios na FSAE 2018.']\n    },\n    especifications: {\n      dtec: 'DTEC-NK218.jpg',\n      data: [{\n        info: 'Motor',\n        data: 'WEG VE-M01'\n      }, {\n        info: 'Autonomia',\n        data: '13 km'\n      }, {\n        info: 'Potncia Mx.',\n        data: '54 cv'\n      }, {\n        info: 'Bitola Diant.',\n        data: '1150 mm'\n      }, {\n        info: 'Torque Mx.',\n        data: '8,2 kgf.m'\n      }, {\n        info: 'Bitola Tras.',\n        data: '1150 mm'\n      }, {\n        info: '0 - 75m',\n        data: '4,6 s'\n      }, {\n        info: 'Entre-eixos',\n        data: '1150 mm'\n      }, {\n        info: 'Velocidade Mx.',\n        data: '99 Km/h'\n      }, {\n        info: 'Massa',\n        data: '267 kg'\n      }, {\n        info: 'Consumo',\n        data: '244 Wh/km'\n      }, {\n        info: 'Massa Diant.',\n        data: '49,9%'\n      }]\n    },\n    subsystems: [{\n      type: 'title',\n      content: 'ELETRNICA'\n    }, {\n      type: 'text',\n      content: 'O foco na otimizao das solues de 2017 em conjunto com o aprimoramento da segurana e da organizao foram os pontos chaves do projeto eletrnico de 2018, que resultaram num ganho significativo de confiabilidade. Houve implementao de watchdog na ECU, para resguardar o carro de travamento de cdigo; comunicao isolada com o inversor e filtragem de dados por superamostragem.'\n    }, {\n      type: 'subsystem',\n      content: 'CONTROLE'\n    }, {\n      type: 'text',\n      content: 'No sistema de controle, foram feitas algumas alteraes tendo em vista atender o uso automotivo: a comunicao com o inversor passou a ser feita em protocolo CAN, reduzindo rudos, e adotaram-se conectores automotivos, com fixao feita em pontos estratgicos e reforada em pontos crticos. Tais providncias conferiram boa confiabilidade quanto  integridade do sinal sob efeito de vibrao intensa, evitando mal contato e perdas de conexo. Os cabos foram envoltos por malha nutica, protegendo-os contra possveis agentes cortantes do ambiente, melhorando a rigidez mecnica e mantendo-os unidos e organizados.'\n    }, {\n      type: 'subsystem',\n      content: 'TELEMETRIA & AQUISIO'\n    }, {\n      type: 'text',\n      content: 'Desenvolveu-se um sistema de telemetria capaz de se comunicar com os outros mdulos do veculo por CAN, seguindo a filosofia geral de projeto, de modo que era possvel transmitir em tempo real as informaes de velocidade do veculo e das quatro rodas separadamente; temperatura dos motores, inversores e acumulador; corrente dos motores e acumulador; carga, tenso, temperatura e corrente das baterias; alm de estado e erros do BMS, ECU e inversores aos boxes. Ademais, foi implementado conjuntamente um sistema de datalog local com o uso de carto SD e microcontrolador, responsvel, tambm, por exibir dados vitais do carro ao piloto por meio do painel no cockpit.'\n    }, {\n      type: 'subsystem',\n      content: 'BANCO DE BATERIAS'\n    }, {\n      type: 'text',\n      content: 'O projeto do banco de baterias do NK-218 se props a tornar o veculo mais competitivo, com a definio de parmetros mais precisos mediante anlises computacionais e uma estratgia voltada para a performance. Tambm visou melhorar a segurana dos operadores e das clulas, assim como otimizar e facilitar a construo e a montagem. A configurao usada consistiu em 24 clulas em srie (divididas em 2 packs de 12 clulas) e 2 ramos em paralelo; a capacidade total de carga foi de 3168 Wh. Ainda, tendo em vista suprir a necessidade de refrigerao, coolers foram adotados para arrefecimento forado do banco.'\n    }, {\n      type: 'subsystem',\n      content: 'BATTERY MONITORING SYSTEM (BMS)'\n    }, {\n      type: 'text',\n      content: 'No BMS 2018, a nova disposio dos sensores e dos mdulos responsveis por fazer as medies contribuiu para uma maior preciso de leitura, que, juntamente ao uso do protocolo ISOSPI e  implementao de watchdogs, assegurou a confiabilidade do sistema. Por fim, a estimativa de carga e o balanceamento de clulas foram feitos com algoritmos mais adequados  aplicao, proporcionando resultados mais precisos e um melhor desempenho das baterias.'\n    }, {\n      type: 'title',\n      content: 'MECNICA'\n    }, {\n      type: 'subsystem',\n      content: 'POWERTRAIN'\n    }, {\n      type: 'text',\n      content: 'Aps novas anlises em 2018, com simulaes que levaram em considerao o novo grip e massa do veculo, manteve-se a reduo de 9:1 em dois estgios, que se mostrou adequada mais uma vez por razes de custo e empacotamento. Com o objetivo de reduzir a massa do sistema e otimiz-lo como um todo, novas geometrias de pea foram desenhadas e um estudo de fadiga iniciado. Tambm, com o desenvolvimento de tensionadores e a aquisio de um novo e mais adequado rolamento para conexo, foi possvel melhorar o tensionamento e o alinhamento das correntes, resultando num sistema mais eficiente.'\n    }, {\n      type: 'subsystem',\n      content: 'CHASSI'\n    }, {\n      type: 'text',\n      content: 'Em 2018, dimensionou-se uma carroceria mais enxuta, cerca de 10% mais leve, e fez-se uso de um modelo matemtico para estimar um valor de rigidez torcional apropriado. Com estudos mais aprofundados via mtodo dos elementos finitos, foi possvel simular o valor de rigidez  toro e analisar os nveis de tenso sofridos durante a operao do veculo. Realizaram-se, ento, diversos testes e aquisies de dados no intuito de validar as anlises computacionais e assegurar o bom desempenho da estrutura.'\n    }, {\n      type: 'subsystem',\n      content: 'AERODINMICA'\n    }, {\n      type: 'text',\n      content: 'O projeto aerodinmico do NK-218 foi feito em fluidodinmica computacional e a sua validao realizada atravs de ensaios em tnel de vento e testes em pista. As anlises de CFD foram feitas em Star CCM+ utilizando-se diversos modelos de turbulncia, um para cada etapa de desenvolvimento, possibilitando uma anlise mais ampla do comportamento do escoamento ao redor do veculo. As anlises para determinar a rigidez da carenagem foram feitas nos softwares Ansys e Abaqus.'\n    }, {\n      type: 'subsystem',\n      content: 'DIREO'\n    }, {\n      type: 'text',\n      content: 'O projeto de direo do prottipo 2018 foi feito com dois objetivos principais: otimizar a geometria de esteramento, para garantir uma melhor utilizao dos pneus, e reduzir as folgas do sistema, para menor tempo de resposta e evitar desgaste prematuro e sobrecarga de peas. Para o cumprimento do primeiro objetivo, foram utilizados dados fornecidos pelo Milliken Research Associate atravs do TTC (Tire Test Consortium) para obter os valores timos de slip angle para cada pneu na condio para a qual o sistema foi projetado. J na realizao do segundo objetivo, focou-se em garantir que a junta universal da coluna de direo trabalhasse da maneira adequada e que todos os componentes fossem bem fixados no chassi.'\n    }, {\n      type: 'subsystem',\n      content: 'SUSPENSO'\n    }, {\n      type: 'text',\n      content: 'Desenvolvido juntamente com o sistema de direo, o projeto de suspenso de 2018 teve por principal meta otimizar o uso dos pneus em relao ao primeiro prottipo e conferir ajustabilidade ao sistema. Isso foi concretizado atravs de simulaes cinemticas mais acuradas, mediante utilizao de dados do TTC e do software Adams Car, que resultaram na elaborao de uma geometria de suspenso mais adequada  finalidade do prottipo. Alm disso, a realizao de revalvulao nos amortecedores tambm conferiu aos pneus melhor interao com a pista. Por fim, o ganho em ajustabilidade deveu-se ao desenvolvimento de barras estabilizadoras ajustveis, que aumentaram significativamente as possibilidades de setups dinmicos.'\n    }, {\n      type: 'subsystem',\n      content: 'FREIOS'\n    }, {\n      type: 'text',\n      content: 'O projeto de freio do NK-218 teve o objetivo de garantir uma desacelerao eficaz ao veculo levando em considerao uma boa ergonomia de pilotagem, visando potncia, preciso e conforto no acionamento. Assim como os sistemas de suspenso e direo desse ano, a modelagem do sistema de freios foi realizada com o auxlio de dados de pneu do FSAE TTC. Alm disso, o pedal box, estrutura que compreende os pedais, cilindros mestres e balance bar, foi projetado analisando-se parmetros anatmicos, como fora do piloto, tamanho do p e comprimento das pernas, para o adequado dimensionamento da alavanca de pedal.'\n    }]\n  },\n  Kayran: {\n    year: 2017,\n    sectionStart: {\n      top: true,\n      left: false\n    },\n    positions: {\n      general: 10,\n      categories: [{\n        name: 'custos',\n        position: 10\n      }, {\n        name: 'apresentao',\n        position: 10\n      }, {\n        name: 'design',\n        position: 8\n      }, {\n        name: 'acelerao'\n      }, {\n        name: 'skidpad'\n      }, {\n        name: 'autocross'\n      }, {\n        name: 'enduro'\n      }],\n      text: ['Desenvolvido em 2017, foi o primeiro prottipo da equipe, colocando em prtica o objetivo dos integrantes de desenvolver tecnologia nacional e transformar estudantes em profissionais capacitados. Embora pesado e de grandes dimenses, por possuir estrutura e componentes robustos, o Kayran era bastante confivel mecanicamente.', 'Foi pioneiro na competio FSAE Brasil ao utilizar a motorizao dupla e o BMS de fabricao prpria e, mesmo sem ter conseguido realizar as provas dinmicas, alcanou dcimo lugar na classificao geral.']\n    },\n    especifications: {\n      dtec: 'DTEC-Kayran.jpeg',\n      data: [{\n        info: 'Motor',\n        data: 'WEG VE-M01'\n      }, {\n        info: 'Autonomia',\n        data: '24 km'\n      }, {\n        info: 'Potncia Mx.',\n        data: '54 cv'\n      }, {\n        info: 'Bitola Diant.',\n        data: '1270 mm'\n      }, {\n        info: 'Torque Mx.',\n        data: '8,2 kgf.m'\n      }, {\n        info: 'Bitola Tras.',\n        data: '1270 mm'\n      }, {\n        info: '0 - 75m',\n        data: '8 s'\n      }, {\n        info: 'Entre-eixos',\n        data: '1550 mm'\n      }, {\n        info: 'Velocidade Mx.',\n        data: '87 Km/h'\n      }, {\n        info: 'Massa',\n        data: '349 kg'\n      }, {\n        info: 'Consumo',\n        data: '264 Wh/km'\n      }, {\n        info: 'Massa Diant.',\n        data: '49,9%'\n      }]\n    },\n    subsystems: [{\n      type: 'title',\n      content: 'ELETRNICA'\n    }, {\n      type: 'text',\n      content: 'O projeto eletrnico de 2017 consistiu em desenvolver um sistema de controle do conjunto trativo, sistema de gerenciamento de bateria e sistemas de segurana. Teve como funes processar a demanda de torque para cada roda; comandar os inversores e, por consequncia, os motores; desenvolver os sistemas de segurana; fazer o sensoriamento dos pedais, volante e velocidade das rodas; gerenciar e proteger as baterias; entre outras funes.'\n    }, {\n      type: 'subsystem',\n      content: 'CONTROLE'\n    }, {\n      type: 'text',\n      content: 'A plataforma de microcontroladores selecionada foi a PIC da Microchip, usada em todas as placas do carro, por questes de manuteno e troca de conhecimento entre os subsistemas; e a comunicao com os inversores feita com protocolo serial RS-485, utilizando par tranado e sinal diferencial. A ECU foi totalmente desenvolvida pela equipe, reduzindo custos e tornando o sistema mais adequado s necessidades do veculo. Ao mesmo tempo, por centralizar o tratamento de dados e ser capaz de se comunicar usando diferentes padres de comunicao, o sistema tornou possvel comandar outros tipos de inversores e drivers, permitindo seu uso em aplicaes diversas.'\n    }, {\n      type: 'subsystem',\n      content: 'BANCO DE BATERIAS'\n    }, {\n      type: 'text',\n      content: 'O projeto do banco de baterias de 2017 foi conduzido com foco em proporcionar autonomia suficiente para o veculo completar a prova de Enduro (22 km) e em fornecer a corrente necessria para que a fora trativa ultrapassasse ligeiramente o limite de aderncia dos pneus, a fim de otimizar a acelerao do prottipo. Utilizaram-se clulas de LiFePO4 da A123 Systems, com capacidade de 20 Ah, na configurao 24s4p.'\n    }, {\n      type: 'subsystem',\n      content: 'BATTERY MONITORING SYSTEM (BMS)'\n    }, {\n      type: 'text',\n      content: 'Visando confiabilidade, total controle sobre o projeto e reduo de custos, o BMS, sistema responsvel por garantir o aproveitamento timo da energia e reduzir os riscos de danos s clulas, tambm foi totalmente desenvolvido pela equipe. Com foco na versatilidade e na fcil manuteno, o design foi pensado de maneira modular, de forma que o centro de tratamento de dados se conectasse a mdulos de aquisio, permitindo sua aplicao em bancos de baterias de uma ampla gama de tecnologias e uma vasta possibilidade de configuraes de clulas. A manuteno tambm era simples, uma vez que os mdulos podiam ser facilmente substitudos. Alm disso, o projeto apresentou alta competitividade de mercado, j que possua as diversas funcionalidades de equivalentes comerciais a um custo reduzido.'\n    }, {\n      type: 'title',\n      content: 'MECNICA'\n    }, {\n      type: 'subsystem',\n      content: 'POWERTRAIN'\n    }, {\n      type: 'text',\n      content: 'O powertrain 2017 contou com dupla motorizao traseira independente com utilizao de diferencial eletrnico. Foi elaborado com motores WEG e transmisso com foco na eficincia e bom empacotamento. Utilizou relao de reduo de 9:1, para maior potencial de acelerao e, principalmente, para fazer com que o ponto de operao mais frequente na prova de Enduro tambm fosse o ponto de maior eficincia do motor. O sistema contou com dois estgios de reduo, sendo composto por um redutor de engrenagens planetrias na sada do motor associado a um sistema pinho, corrente e coroa. Por fim, semieixos homocinticos foram empregados para transmitir o torque das coroas para as rodas.'\n    }, {\n      type: 'subsystem',\n      content: 'CHASSI'\n    }, {\n      type: 'text',\n      content: 'As principais demandas consideradas na escolha do tipo de chassi foram rigidez estrutural, facilidade de fabricao, peso e custo. O material selecionado foi o ao baixo carbono (SAE 1020), devido ao baixo custo e boa soldabilidade. Tambm, valorizaram-se escolhas de projeto que resultassem em alta rigidez torcional, o que foi posto em prtica com a adoo de tubos de seo quadrada em determinadas regies do veculo. Durante o processo de fabricao, utilizaram-se gabaritos de MDF, de elevado custo-benefcio, a fim de garantir os ngulos e distncias corretas da estrutura e permitir sua soldagem com mnima deformao.'\n    }, {\n      type: 'subsystem',\n      content: 'AERODINMICA'\n    }, {\n      type: 'text',\n      content: 'Por no possuir pacote aerodinmico, o foco do projeto da carenagem foi obter o menor arrasto aerodinmico possvel. Alm disso, deu-se importncia  facilidade de fabricao,  qualidade de acabamento e ao baixo custo. Foram realizadas simulaes CFD no programa Ansys para a otimizao da geometria do bico. Tambm foram desenvolvidos sidepods com o objetivo de direcionar o fluxo de ar para os motores e acumulador, melhorando o arrefecimento.'\n    }, {\n      type: 'subsystem',\n      content: 'DIREO'\n    }, {\n      type: 'text',\n      content: 'O sistema de direo do prottipo Kayran foi projetado de forma a conciliar desempenho e ergonomia. Adotou-se uma razo de esteramento de 5:1 e um volante de grande dimetro, resultando em uma direo mais leve e ergonmica. Tambm foram empregados geometria Ackermann e acionamento do tipo pinho-cremalheira de dentes retos.'\n    }, {\n      type: 'subsystem',\n      content: 'SUSPENSO'\n    }, {\n      type: 'text',\n      content: 'Visando maximizar o contato dos pneus com o solo, adotou-se uma suspenso do tipo duplo A, que proporciona tima estabilidade e controle, alm de grande ajustabilidade. Utilizando-se configurao pullrod na dianteira e pushrod na traseira, foi possvel alcanar timo empacotamento e bom aproveitamento do curso do coilover.'\n    }, {\n      type: 'subsystem',\n      content: 'FREIOS'\n    }, {\n      type: 'text',\n      content: 'Com foco na segurana do piloto e boa performance de frenagem, o prottipo 2017 foi equipado com freios a disco nas quatro rodas e pinas flutuantes, contando com duas linhas hidrulicas, divididas em dianteira e traseira. Os discos foram cortados a laser em ao SAE 1045 e o pedal de freio, cortado a gua em alumnio.'\n    }]\n  }\n};\nconst years = [{\n  year: ''\n}, {\n  year: ''\n}, {\n  year: '2017',\n  car: 'Kayran',\n  image: 'kayran.png',\n  description: 'Primeiro prottipo da equipe, dando vida ao objetivo dos integrantes de desenvolver tecnologia nacional e formar profissionais capacitados.',\n  to: '/prototipos/Kayran',\n  initialYear: false,\n  time: '4,6s',\n  velocity: '350km/h',\n  potency: '25kW'\n}, {\n  year: '2018',\n  car: 'NK218',\n  image: 'NK218.png',\n  description: 'Coroado com o segundo lugar geral da competio, o modelo conta com diversos prmios na FSAE 2018.',\n  to: '/prototipos/NK218',\n  initialYear: false,\n  time: '4,5s',\n  velocity: '340km/h',\n  potency: '24kW'\n}, {\n  year: '2019',\n  car: 'NK319',\n  image: 'NK319.png',\n  description: 'O grande empenho da equipe durante o ano levou ao primeiro lugar na prova de projeto.',\n  to: '/prototipos/NK319',\n  initialYear: true,\n  time: '4,4s',\n  velocity: '330km/h',\n  potency: '23kW'\n}, {\n  year: '2020/21',\n  car: 'NK420',\n  image: 'NK420.png',\n  description: 'Carro em desenvolvimento.',\n  to: '/prototipos/NK420',\n  initialYear: false,\n  time: '-',\n  velocity: '-',\n  potency: '-'\n}, {\n  year: '2022',\n  car: 'NK420',\n  image: 'NK420.png',\n  description: 'Carro em desenvolvimento.',\n  to: '/prototipos/NK420',\n  initialYear: false,\n  time: '-',\n  velocity: '-',\n  potency: '-'\n}];//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/providers/prototiposProvider.ts\n");

